(function($) {
	$.fn.inview = function(options) {

		var defaults = {
			'viewFactor': 0.3,
			'onEnter': function($object) {
			},
			'onLeave': function($object) {
			}
		};
		var custom = $.extend(defaults, options);

		var blockList = [];

		this.each(function() {
			var $block = $(this);

			var block = {};
			block.top = $block.offset().top;
			block.height = $block.innerHeight();
			block.bottom = block.top + block.height;
			block.obj = $block;
			block.inView = null;

			blockList.push(block);
		});

		var globaList = $(window).data('inView.globaList') || [];
		globaList.push({
			'options': custom,
			'blockList': blockList
		});
		$(window).data('inView.globaList', globaList);
		
		function changeWindow() {
			var documentTop = $(window).scrollTop();
			var documentBottom = documentTop + $(window).innerHeight();

			var globaList = $(window).data('inView.globaList');
			
			for (var j = 0; j < globaList.length; j++) {
				var options = globaList[j].options;
				var blockList = globaList[j].blockList;
				for (var i = 0; i < blockList.length; i++) {
					var block = blockList[i];

					var top = Math.max(documentTop, block.top);
					var bottom = Math.min(documentBottom, block.bottom);

					var height = bottom - top;

					if (block.inView !== true && height / block.height >= options.viewFactor) {
						blockList[i].inView = true;
						block.obj.addClass(block.obj.data('class-in'));
						block.obj.removeClass(block.obj.data('class-out'));
						if(typeof options.onEnter === 'function')
							options.onEnter(block.obj);

					} else if (block.inView !== false && height <= 0) {
						blockList[i].inView = false;
						block.obj.addClass(block.obj.data('class-out'));
						block.obj.removeClass(block.obj.data('class-in'));
						if(typeof options.onLeave === 'function')
							options.onLeave(block.obj);

					}
				}
			}
		}

		if (!$(window).data('inView.initialized')) {
			$(window).data('inView.initialized', true);
			$(window).on({
				'scroll': changeWindow,
				'resize': changeWindow
			});
		}
		$(window).trigger('resize');

	};
})(jQuery);


var isMobile = ''
var isiPad = ''

if (navigator.userAgent.match(/Android/i) 
 	|| navigator.userAgent.match(/webOS/i) 
 	|| navigator.userAgent.match(/iPhone/i) 
 	|| navigator.userAgent.match(/iPod/i) 
 	|| navigator.userAgent.match(/BlackBerry/i) 
 	|| navigator.userAgent.match(/Windows Phone/i)){

	isMobile = true
} else {
	isMobile = false
}

if (navigator.userAgent.match(/iPad/i)) {
	isiPad = true
} else {
	isiPad = false
}

function getParameterByName(name, url){
    if (!url) url = window.location.href;
    name = name.replace(/[\[\]]/g, "\\$&");
    var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, " "));
}

var pathHome = ['/', '/index.html', '/default.aspx', '/home.aspx', '/pttgcgroup/', '/ptt-global-chemical/']
var pathname = window.location.pathname
var isHome = pathHome.indexOf(pathname) > -1
var sectionName = localStorage.getItem('sectionName')

// scroll page -------------------------------------------------------------
function scrollToPage(id, cb){
	if (!isHome) {
		localStorage.setItem('sectionName', id)
		window.location.href = './'
	}

	var ssTop

	if (isiPad) {
		ssTop = 90
	} else if (isMobile) {
		ssTop = 60
	} else {
		ssTop = 108
	}

	$('html, body').animate({
		scrollTop: $('#'+id).offset().top-ssTop
	}, 1000, cb)

	$('.toggle-nav').removeClass('open')
	$('header .panel').removeClass('open')
} // end scroll page -------------------------------------------------------


// executive talk ----------------------------------------------------------
function closeFloatBox(){
	$('.float-text').hide(1)
	$('#executive-talk .board').css('z-index', 1)
	$('#executive-talk .board > img').removeClass('active blur')
} // end executive talk ----------------------------------------------------

var teamSlides = ''
var currentTeamSlides = ''
var currentTeamIndex = 0

$(function(){
	// load header ---------------------------------------------------------
	$.ajax({
		url: './header.html',
		success: function(data){
			$('.container').prepend(data)
		}
	}) // end load header --------------------------------------------------


	// load footer ---------------------------------------------------------
	$.ajax({
		url: './footer.html',
		success: function(data){
			$('.container').append(data)
		}
	}) // end load footer --------------------------------------------------


	// hero banner ---------------------------------------------------------
	$('#hero-banner .slide').bxSlider({
		auto: true,
		pause: 5000,
		controls: false,
		speed: 800
	})

	if (!isMobile) {
		var bgImg = document.getElementById('hero-banner')
		var executiveTalk = document.getElementById('executive-talk')

		if (bgImg) {
			bgImg.addEventListener('mousemove', function(e){
				var x = e.pageX / document.body.clientWidth
		
				x = x * -30
		
				$('.gyro img').css('transform', 'translateX('+x+'px)')
			})
		}

		if (executiveTalk) {
			executiveTalk.addEventListener('mousemove', function(e){
				var x = e.pageX / document.body.clientWidth
		
				x = x * -60
		
				$('#executive-talk').css('background-position-x', x+'px')
			})
		}
	} // end hero banner ---------------------------------------------------


	// main work slide -----------------------------------------------------
	$('#main-work-slide .slide').bxSlider({
		controls: false,
		speed: 800
	}) // end main work slide ----------------------------------------------


	// main life -----------------------------------------------------------
	$('#main-life .slide').bxSlider({
		speed: 800,
		pager: false,
		infiniteLoop: false,
		hideControlOnEnd: true
	}) // end main life ----------------------------------------------------


	// main career ---------------------------------------------------------
	// $('#main-career .slide').bxSlider({
	// 	speed: 800,
	// 	controls: false
	// })


	// career article ------------------------------------------------------
	$('#career-article-slide .slide').bxSlider({
		speed: 800,
		controls: false
	})


	// toggle nav mobile ---------------------------------------------------
	$(document).on('click', '.toggle-nav', function(){
		if ($(this).hasClass('open')) {
			$(this).removeClass('open')
			$('header .panel').removeClass('open')
		} else {
			$(this).addClass('open')
			$('header .panel').addClass('open')
		}
	}) // end toggle nav ---------------------------------------------------


	// main teams ----------------------------------------------------------
	var quotes = [
		'0 Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. anim id est laborum.',
		'1 Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in',
		'          ',
		'3 Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?',
		'4 adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis',
		'5 consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur',
		'6 veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia'
	]

	function setOptionsMainTeam(){
		var defaultObj = {
			pager: false,
			minSlides: 1,
			moveSlides: 1,
			slideWidth: 140,
			slideMargin: 40,
			touchEnabled: false,
			infiniteLoop: true,
			hideControlOnEnd: true,
			onSliderLoad: function(){
				//$('.team-slide>li:not(.bx-clone)').eq(2).addClass('active')
			},
			onSlideBefore: function($slideElement, oldIndex, newIndex){
				$('.team-slide > li').removeClass('active')
				$('.team-quote').hide(1)
			},
			onSlideAfter: function($slideElement, oldIndex, newIndex){
				var contentID = $($slideElement).next().next().attr('data-id')
				// currentTeamSlides = contentID
				// currentTeamIndex = newIndex

				console.log('currentTeamIndex', newIndex)
				// console.log('currentTeamSlides', currentTeamSlides)

				$($slideElement).next().next().addClass('active')
				$('.team-quote').html(quotes[contentID])
				$('.team-quote').show(1)
			}
		}

		// ipad --------------------------------------------------------
		if (navigator.userAgent.match(/iPad/i)) {
			var obj = Object.assign(defaultObj, {
				maxSlides: 4
			})

			return obj
		}

		// mobile ------------------------------------------------------
		if (navigator.userAgent.match(/iPhone/i) || 
			navigator.userAgent.match(/Android/i) || 
			navigator.userAgent.match(/BlackBerry/i) || 
			navigator.userAgent.match(/Windows Phone/i)) {
			
			var obj = Object.assign(defaultObj, {
				maxSlides: 2,
				slideWidth: 120,
				slideMargin: 27
			})

			return obj
		}

		return Object.assign(defaultObj, {
			maxSlides: 5
		})
	}

	teamSlides = $('.team-slide').bxSlider(setOptionsMainTeam())

	$(document).on('click', '.team-slide > li', function(){
		var id = $(this).attr('data-id')

		$(this).addClass('active').siblings('li').removeClass('active')
		$('.team-quote').html(quotes[id])
		$('.team-quote').show(1)
		
		if (id == 0) {
			teamSlides.goToSlide(3)
		} else if (id == 1) {
			teamSlides.goToSlide(4)
		} else {
			teamSlides.goToSlide(id-2)
		}
	}) // end main teams ---------------------------------------------------


	// hot jobs ------------------------------------------------------------
	$(document).on('click', '.job-item .toggle', function(){
		if ($(this).parent('.job-item').hasClass('expand')) {
			$(this).parent('.job-item').removeClass('expand')
		} else {
			$(this).parent('.job-item').addClass('expand')
		}
	}) // end hot jobs -----------------------------------------------------


	// scrollto ------------------------------------------------------------
	if (sectionName) {
		scrollToPage(sectionName, function(){
			localStorage.removeItem('sectionName')
		})
	} // end scrollto ------------------------------------------------------


	// our people slide ----------------------------------------------------
	function getOurPeopleValue(){
		if (isMobile) {
			return {
				item: 1,
				slideMargin: 0,
				width: 270
			}
		} else if (isiPad) {
			return {
				item: 2,
				slideMargin: 25,
				width: 300
			}
		} else {
			return {
				item: 3,
				slideMargin: 25,
				width: 300
			}
		}
	}

	$('#our-people .slide-list').bxSlider({
		pager: false,
		maxSlides: getOurPeopleValue().item,
		minSlides: getOurPeopleValue().item,
		moveSlides: 1,
		slideWidth: getOurPeopleValue().width,
		slideMargin: getOurPeopleValue().slideMargin,
		touchEnabled: false,
		infiniteLoop: true,
		hideControlOnEnd: true
	}) // end our people slide ---------------------------------------------


	// career gallery slide ------------------------------------------------
	function getCareerGalleryValue(){
		if (isMobile) {
			return {
				item: 2,
				width: 140
			}
		} else if (isiPad) {
			return {
				item: 3,
				width: 220
			}
		} else {
			return {
				item: 4,
				width: 220
			}
		}
	}

	$('.career-gallery .slide').bxSlider({
		pager: false,
		maxSlides: getCareerGalleryValue().item,
		minSlides: getCareerGalleryValue().item,
		moveSlides: 1,
		slideWidth: getCareerGalleryValue().width,
		slideMargin: isMobile ? 10 : 15,
		touchEnabled: false,
		infiniteLoop: true,
		hideControlOnEnd: true
	}) // end career gallery slide -----------------------------------------


	// parallax scroll -----------------------------------------------------
	$('.container > div > .wrap-center').inview({
		viewFactor: 0.2,
		onEnter: function(obj){
		},
		onLeave: function(obj){
		}
	}) // end parallax scroll ----------------------------------------------


	// executive talk ------------------------------------------------------
	$('#executive-talk .board > img').click(function(){
		closeFloatBox()
		$(this).parent('div').css('z-index', '5')
		$(this).removeClass('blur').addClass('active').parent('div').siblings('div').children('img').addClass('blur').removeClass('active')
		$(this).next('div').delay(300).fadeIn(100)
	}) // end executive talk -----------------------------------------------


	// get in touch --------------------------------------------------------
	$('#get-in-touch .slide').bxSlider({
		pager: false
	}) // end get in touch -------------------------------------------------
})


// faq ---------------------------------------------------------------------
$(document).on('click', '.toggle', function(e){
	$(this).toggleClass('open closed')
    
	var content = $(this).next('.acc')
    
    content.inner = content.children('.inner')
    content.toggleClass('open closed')
    content.contentHeight = content.outerHeight()
    
    if (content.hasClass('closed')) {
        content.removeClass('transitions').css('max-height', content.contentHeight)
        
        setTimeout(function(){
            content.addClass('transitions').css({
                'max-height': 0,
                'opacity': 0
            })
        }, 10)
    } else if (content.hasClass('open')) {
        content.contentHeight += content.inner.outerHeight()
        
        content.css({
            'max-height': content.contentHeight,
            'opacity': 1
        })
    }
}) // end faq --------------------------------------------------------------


